import React from 'react';
import { navStyle } from '../navStyle';
import Button from 'react-bootstrap/Button';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';

class Navigation extends React.Component {

  render() {

    let { color, backgroundColor, brand } = navStyle;

    return (
      <div>
        <Navbar.Collapse style={{backgroundColor}}>
            <Navbar.Brand style={brand} href="#home">Personal Capital</Navbar.Brand>
            <Nav className="justify-content-end">
              <Nav.Item>
                <Nav.Link style={{color}} href="/home">Financial Tools</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link style={{color}} eventKey="link-1">Wealth Management</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link style={{color}} eventKey="link-2">About</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Nav.Link style={{color}} eventKey="link-2">Resources</Nav.Link>
              </Nav.Item>
              <Nav.Item>
                <Button href="#">Login</Button>
              </Nav.Item>
              <Nav.Item>
                <Button href="#">Sign Up</Button>
              </Nav.Item>
            </Nav>
        </Navbar.Collapse>

      </div>
    )
  }
}

export default Navigation;
